import React from 'react';
import { Link } from 'react-router-dom';
import './RestaurantCard.css';

const RestaurantCard = ({ restaurant }) => {
    return (
        <div className="restaurant-card">
            <img src={restaurant.thumb} alt={restaurant.name} className="restaurant-image" />
            <div className="restaurant-info">
                <h3>{restaurant.name}</h3>
                <p>{restaurant.cuisines}</p>
                <p>₹{restaurant.average_cost_for_two} for two</p>
                <p>{restaurant.user_rating.aggregate_rating} ★</p>
                <Link to={`/restaurant/${restaurant.id}`} className="view-details">View Details</Link>
            </div>
        </div>
    );
};

export default RestaurantCard;
